def count_ways(n, k):
    if n == 0:
        return k
    if n == 1:
        return k**2

    dp = [[0] * k for _ in range(n+1)]
    dp[0].append(1)
    dp[1].append(k)

    for i in range(2, n+1):
        for j in range(k):
            dp[i][j] = (k-1) * (dp[i-1][j] + dp[i-2][j])

    return sum(dp[n])

